styles:
.pop-client-filter-container {
  display: flex;
  flex-direction: column;
  width: 100%;
  box-sizing: border-box;
  /*align-items: center;*/
  padding: 0;
}

.pop-field-item-help-text {
  position: relative;
  font-size: 1.5em;
  color: var(--text-disabled);
  z-index: 2;
}

.pop-template-ajax-loader {
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
}

.pop-template-ajax-row {
  display: flex;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  clear: both;
}

.pop-template-welcome {
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  font-size: 1.5em;
  background: var(--background-2);
}

.pop-template-welcome-row {
  display: flex;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  clear: both;
}

.pop-template-goodbye {
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  font-size: 1.5em;
}

.pop-template-goodbye-row {
  display: flex;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  clear: both;
}

.pop-template-error {
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  font-size: 1em;
  color: white;
  padding: 10px;
  background: red;
  box-sizing: border-box;
}

.pop-template-error-row {
  display: flex;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  clear: both;
  word-wrap: break-word;
  box-sizing: border-box;
}

.pop-template-buffer {
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  font-size: 1.5em;
  background: var(--background-code);
}

.pop-template-buffer-row {
  display: flex;
  width: 100%;
  min-height: 30px;
  justify-content: center;
  align-items: center;
  clear: both;
}
